The map that you probably won't like is here. 

Features:
-Average-sized map, containing about 25 awful levels;
-Blocky training room at the end;
-Difficulty varies from "wtfisdisshit" to "ffffffffuuuuuuuuuuuuuu";
-Raging kids because textures and obstacles are similar to Daemon's/Revo's;
-Photoshop madskillz appear to be a few textures;
-Extraordinaire beginning, that doesn't even fit in the style of the map.

